import "../css/nopage.css"

const NoPage = () => {
    return (
      <div>
        <h1>Far out!</h1>
        <h2>We're not sure how you got here...
          But you may be lost in cyberspace
        </h2>
        <button class="404__button">Return Home</button>
    </div>
    )
  };
  
  export default NoPage;
